import{_ as e,o as a,c as t,O as n}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 3.2-2600 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-2600.md","filePath":"vacode/3.2-2600.md"}'),r={name:"vacode/3.2-2600.md"},i=n('<h1 id="§-3-2-2600-definitions" tabindex="-1">§ 3.2-2600 Definitions. <a class="header-anchor" href="#§-3-2-2600-definitions" aria-label="Permalink to &quot;§ 3.2-2600 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Aquaculture&quot; means the propagation, rearing, enhancement, and harvest of aquatic organisms in controlled or selected environments, conducted in marine, estuarine, brackish, or fresh water.</p><p>&quot;Aquaculture facility&quot; means any land, structure, or other appurtenance that is used for aquaculture, including any laboratory, hatchery, pond, raceway, pen, cage, incubator, or other equipment used in aquaculture.</p><p>&quot;Aquatic organism&quot; means any species or hybrid of aquatic animal or plant, including fish, shellfish, marine fish, and marine organisms as those terms are defined by § <a href="http://law.lis.virginia.gov/vacode/28.2-100/" target="_blank" rel="noreferrer">28.2-100</a>.</p><p>1992, c. 643, § 3.1-73.6; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',6),o=[i];function s(c,u,d,l,h,p){return a(),t("div",null,o)}const m=e(r,[["render",s]]);export{f as __pageData,m as default};
